# ## Crazy hack: use JavaScript

# You can display an image using JavaScript. This will let you embed *any arbitrary image in your notebook*! In the following example, we load something off Imgur.

# In[ ]:


from IPython.core.display import display, HTML, Javascript
import IPython.display

html_string = """
<g id="my_image_goes_here"></g>
"""

js_string = """
require.config({
    paths: {
        d3: "https://d3js.org/d3.v4.min"
     }
 });

require(["d3"], function(d3) {
  
  d3.select("#my_image_goes_here")
      .append("img")
      .attr("src", "https://i.imgur.com/xgKeain.jpg")
      .attr("width", "250px");

});
"""

h = display(HTML(html_string))
j = IPython.display.Javascript(js_string)
IPython.display.display_javascript(j)


# As long as you're fine writing JavaScript code to do your analysis and output, you can dynamically run code on and display images hosted totally off-site. You can do some sophisticated stuff with that.

